const useInstrumentPage = () => {
    fetch('https://prototype.sbulltech.com/api/v2/quotes/SBIN')
        .then(function(response) {
            return response.text();
        }).then(function(data) {
            const arr = data.split('\n');
            let array = [];
            arr.forEach((element, index) => {
            const companyInfo = element.split(',');
            if(companyInfo[0] && index !== 0){
                array = [
                ...array,
                {
                    symbol: companyInfo[0],
                    name: companyInfo[1],
                    sector: companyInfo[2],
                    validTill: companyInfo[3],
                }
                ]; 
            } 
            });
        });
};

export default useInstrumentPage;
